import React from "react";

function Table(props){
    let thub = props.thumbnail
    let source = "/imag/" + thub
    console.log()
    return (
        <tr id={props.ID} className="border-bottom ">
            <td className="{{props.ID}}" ></td> 
            <td><img src={source} alt=""/></td>
            <td className="FirstName" onDoubleClick="update(this, 'FirstName', '{props.ID}', '{props.FirstName}')">{props.FirstName }</td>
            <td className="LastName" onDoubleClick="update(this, 'LastName', '{props.ID}', '{props.LastName}')">{props.LastName }</td>
            <td className="height" onDoubleClick="update(this, 'height', '{props.ID}', '{props.height}')">{props.height}</td>

            <td>
                <button className="btn btn-outline-danger" onClick="props.deleteMe('{props.ID}')" ><i className="fa-sharp fa-solid fa-trash"></i></button>
            </td>
        </tr>
    )
}

export default Table;
